import Dropdown from 'react-bootstrap/Dropdown';

const ClubsDropdown = ({clubs}) => {
    let clubOptions = clubs;
    const renderClubOptions = (club) => {
        for (let club of clubs) {
            return (
                <Dropdown.Item href="#/action-1">{club}</Dropdown.Item>
            )
        }
    }
    return (
        <Dropdown>
            <Dropdown.Toggle variant="success" id="dropdown-basic">
                Dropdown Button
            </Dropdown.Toggle>
        <Dropdown.Menu>
            {renderClubOptions}
        </Dropdown.Menu>
      </Dropdown>
    )

}

export default ClubsDropdown;
